      .login {
        width: 50%;
        padding: 16px;
        display: flex;
        flex-grow: 1;
        justify-content: center;
        align-items: center;
      }
      .badge {
        width: fit-content;
        font-style: normal;
        font-weight: 600;
        font-size: 12px;
        line-height: 14px;
        text-align: left;
        letter-spacing: 1.5px;
        text-transform: uppercase;
        color: #02525e;
        background: #fef2e0;
        padding: 2px 4px;
        border-radius: 4px;
      }

      #forgotPassword,
      .intro {
        display: none;
      }
      h2 {
        font-family: Open Sans;
        font-style: normal;
        font-weight: 600;
        font-size: 36px;
        line-height: 54px;
        text-transform: uppercase;
        color: #02525e;
        margin-bottom: 2rem;
      }

      /** Localize content **/
      .imprint.imprint-en:lang(en),
      .imprint.imprint-da:lang(da) {
        display: inherit !important;
      }

      .imprint {
        display: none;
      }
      /** END Localize content **/

      /** Form **/
      form {
        display: flex;
        flex-direction: column;
      }
      .login-form {
        width: 100%;
        max-width: 390px;
      }
      .entry-item {
        display: flex;
        flex-direction: column;
      }
      .error {
        font-style: normal;
        font-weight: normal;
        font-size: 12px;
        line-height: 18px;
        color: #d12923;
        order: 2;
        margin-top: -1rem;
      }
      .entry-item-error label {
        color: #d12923 !important;
      }
      .error.itemLevel {
        min-height: 18px;
      }
      .error.pageLevel {
        margin-top: 0.5rem;
      }
      .highlightError {
        outline: 1px solid #d12923 !important;
        border: none;
      }
      label {
        font-family: 'Open Sans', sans-serif;
        font-style: normal;
        font-weight: 600;
        font-size: 12px;
        line-height: 14px;
        letter-spacing: 1.5px;
        text-transform: uppercase;
        color: #02525e;
        margin-bottom: 0.5rem;
      }
      input {
        font-family: 'Open Sans', sans-serif;
        font-style: normal;
        font-weight: normal;
        font-size: 14px;
        line-height: 21px;
        height: 44px;
        outline: 1px solid #bdbdbd;
        border: none;
        color: #02525e;
        border-radius: 3px;
        margin-bottom: 1rem;
        padding: 0 12px;
      }
      input:focus-visible {
        outline: 1px solid #00847c;
      }
      button {
        width: 100%;
        height: 40px;
        background: #00847c;
        box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25),
          0px 4px 4px rgba(0, 0, 0, 0.25);
        border-radius: 4px;
        padding: 8px 16px;
        border: none;
        font-family: Open Sans;
        font-style: normal;
        font-weight: 600;
        font-size: 14px;
        color: #ffffff;
        line-height: 16px;
        letter-spacing: 1.25px;
        text-transform: uppercase;
        cursor: pointer;
        outline: none;
      }
      button:focus,
      button:focus-visible,
      button:hover {
        background-color: rgb(2, 82, 94);
      }
    </style>
    <script>
      function waitFor(selector, callback) {
        var elm = document.querySelector(selector);

        if (elm) {
          callback(elm);
        } else {
          setTimeout(function () {
            waitFor(selector, callback);
          }, 100);
        }
      }

      function toggleErrorClasses() {
        document.querySelectorAll('input').forEach((inputElement) => {
          var parent = inputElement.parentElement;
          var hasError = inputElement.classList.contains('highlightError');
          if (!parent) return;

          if (hasError) {
            parent.classList.add('entry-item-error');
          } else {
            parent.classList.remove('entry-item-error');
          }
        });
      }

      waitFor('button#next', function (element) {
        element.addEventListener('click', toggleErrorClasses);
      });
    </script>
  </head>
  <body>
    <div class="background">
      <div class="logo"></div>
    </div>
    <div class="login">
      <div class="login-form">
        <p class="badge">BETA</p>
        <h2 aria-level="1" class="imprint imprint-da">LOG IND</h2>
        <h2 aria-level="1" class="imprint imprint-en">SIGN IN</h2>
        <div id="api"></div>
      </div>
    </div>
  </body>
</html>
